import axios from "axios";
import { useState, useEffect } from "react"
import clientServices from "../services/ClientService";
function ClientList (){

     
  const [clients, setClients] = useState([])
  async function getClients(){
    try {
        const result=  clientServices.getAllClient()
        setClients(result.data)
    } catch (error) {
        console.log(result.data)
    }
      
      
    }
    useEffect (()=>{
        getClients();
    },[])
return ( 
    <table>
        <tr>
            <th>Company</th>
            <th>Contact</th>
            <th>Country</th>
        </tr>
          {clients.map((elem,i)=>{
                return <tr key={i}><td>{elem.last_name}</td><td>{elem.first_name}</td><td>{elem.cin}</td></tr>
          })}
    </table>
)}

export default ClientList;
